import './App.css';
import axios from 'axios';
import { useState } from 'react';

function App() {

  // API Connection
  const urlAPI = "https://localhost:44384/api/Products";

  const data = [data, setData] = useState([]);

  const requestGet = async() =>{
      await axios.get(urlAPI)
      .then(response => {
        setData(response.data)
      })
  }


  return (
    <div className="App">
        <div className="container">
            <h1>Products</h1>
            <button className="btn createNew">Create New Product</button>
            <table>
              <tr>
                <th>Id</th>
                <th>Name</th>
                <th>Description</th>
                <th>Price</th>
                <th>Options</th>
              </tr>
              <tr>
                <td>Peter</td>
                <td>Griffin</td>
                <td>Griffin</td>
                <td>Griffin</td>
                <td>
                    <button className="btn edit-btn">Edit</button>
                    <button className="btn delete-btn">Delete</button>
                </td>
              </tr>
              <tr>
                <td>Lois</td>
                <td>Griffin</td>
                <td>Griffin</td>
                <td>Griffin</td>
                <td>
                    <button className="btn edit-btn">Edit</button>
                    <button className="btn delete-btn">Delete</button>
                </td>
              </tr>
            </table>
        </div>
    </div>
  );
}

export default App;
